function App() {
  const context = React.useContext(AuthContext);
  return (
    <AuthProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/dashboard" element={<DashboardContainer />} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
